async () => {
  if (appsmith.store.trackedPlayers === undefined) {
    await storeValue("trackedPlayers", []);
  }
  var toAdd = titledPlayers.triggeredRow.name;
  if (toAdd !== undefined) {
    var playerset = new Set(appsmith.store.trackedPlayers);
    playerset.add(toAdd);
    await storeValue("trackedPlayers", Array.from(playerset));
  }
}

